import React, { useState } from 'react';
import { Container, Grid, List, ListItem, ListItemText, Typography, Button, Paper, AppBar, Toolbar, IconButton } from '@mui/material';
// import MenuIcon from '@mui/icons-material/Menu'; // Import MenuIcon from MUI

interface Device {
  id: number;
  name: string;
}

interface App {
  id: number;
  name: string;
  runHistory: string[]; // Assuming run history is an array of strings
}

export const DashboardPage = (props: {callback: (curr: string) => void}) => {
  const [selectedDevice, setSelectedDevice] = useState<Device | null>(null);
  const [selectedApp, setSelectedApp] = useState<App | null>(null);

  const devices: Device[] = [
    { id: 1, name: 'Device 1' },
    { id: 2, name: 'Device 2' },
    { id: 3, name: 'Device 3' },
  ];

  const installedApps: App[] = selectedDevice ? [
    { id: 1, name: 'App 1', runHistory: ['Run 1', 'Run 2', 'Run 3'] },
    { id: 2, name: 'App 2', runHistory: ['Run 1', 'Run 2', 'Run 3'] },
    { id: 3, name: 'App 3', runHistory: ['Run 1', 'Run 2', 'Run 3'] },
  ] : [];

  const availableApps: App[] = [
    { id: 4, name: 'App 4', runHistory: ['Run 1', 'Run 2', 'Run 3'] },
    { id: 5, name: 'App 5', runHistory: ['Run 1', 'Run 2', 'Run 3'] },
    { id: 6, name: 'App 6', runHistory: ['Run 1', 'Run 2', 'Run 3'] },
  ];

  const handleDeviceSelect = (device: Device) => {
    setSelectedDevice(device);
    setSelectedApp(null); // Reset selected app when changing devices
  };

  const handleAppSelect = (app: App) => {
    setSelectedApp(app);
  };

  const handleAppInstall = (app: App) => {
    // Add your installation logic here
    console.log(`Installing app ${app.name} on device ${selectedDevice?.name}`);
  };

  return (
    <Container>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            App Name
          </Typography>
          <Button variant="contained" color="primary" onClick={() => handleAppInstall(app)}>Install</Button>
        </Toolbar>
      </AppBar>
      <Grid container spacing={3}>
        <Grid item xs={3}>
          <Paper>
            <Typography variant="h5" align="center" gutterBottom>Devices</Typography>
            <List>
              {devices.map(device => (
                <ListItem key={device.id} button onClick={() => handleDeviceSelect(device)}>
                  <ListItemText primary={device.name} />
                </ListItem>
              ))}
            </List>
          </Paper>
        </Grid>
        <Grid item xs={6}>
          {selectedDevice ? (
            <Paper>
              <Typography variant="h5" align="center" gutterBottom>Installed Apps</Typography>
              <List>
                {installedApps.map(app => (
                  <ListItem key={app.id} button onClick={() => handleAppSelect(app)}>
                    <ListItemText primary={app.name} />
                  </ListItem>
                ))}
              </List>
            </Paper>
          ) : (
            <Typography variant="body1" align="center">Select a device to view its apps</Typography>
          )}
        </Grid>
        <Grid item xs={3}>
          {selectedDevice && (
            <Paper>
              <Typography variant="h5" align="center" gutterBottom>Available Apps to Install</Typography>
              <List>
                {availableApps.map(app => (
                  <ListItem key={app.id}>
                    <ListItemText primary={app.name} />
                    <Button variant="contained" color="primary" onClick={() => handleAppInstall(app)}>Install</Button>
                  </ListItem>
                ))}
              </List>
            </Paper>
          )}
        </Grid>
      </Grid>
      {selectedApp && (
        <Paper>
          <Typography variant="h5" align="center" gutterBottom>{selectedApp.name} Run History</Typography>
          <List>
            {selectedApp.runHistory.map((run, index) => (
              <ListItem key={index}>
                <ListItemText primary={run} />
              </ListItem>
            ))}
          </List>
        </Paper>
      )}
    </Container>
  );
};
